import React from 'react';
import { Container } from '../home/styled'
import { GiConwayLifeGlider } from "react-icons/gi";

function Home() {
  return (
    <Container>
      <div id="fundo">
        <div id="barraLateral">
          <GiConwayLifeGlider size={36} color="#FFF" padding="20px" />
        </div>
      </div>
    </Container>


  )
}

export default Home;
